import React, { Component } from 'react';
import './CompareCompany.css';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import {Row,Col,Button,Form} from 'react-bootstrap';
import NavWithDropDownUser from '../UserNavBar';
import {Link} from 'react-router-dom';
import {
    withRouter
  } from 'react-router-dom';

class CompareCompany extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDownUser />
                <br></br>
                <br></br>
                <br></br>
                <div id="compare-main-div">
                <Card className="text-center" id="text-header-cc">
                <Card.Header>{this.props.type}</Card.Header>
                <Card.Body>
                    
                    <Form className="justify-content-center" onSubmit={this.generateMap}>
                        <Form.Group>
                            <Form.Label>User Name</Form.Label>
                            <Form.Control id="name" type="text" placeholder="Enter Username" required />
                        </Form.Group>

                        <Form.Group>
                            <Form.Label>Password</Form.Label>
                            <Form.Control id="password" type="password" placeholder="Password" required />
                        </Form.Group>
 
                        
                        <Button variant="primary" type="submit">
                            {this.props.type}
                        </Button>
                        
                    </Form>
                       
                </Card.Body>
            
                </Card>
                </div>
            </React.Fragment>
            
        );
    }
}

export default CompareCompany;
